public class StackSetFactory(string resourceName = null, Action<Humidifier.CloudFormation.StackSet> factoryAction = null) : ResourceFactory<Humidifier.CloudFormation.StackSet>(resourceName)
{

    internal List<InnerStackSetParameterFactory> ParametersFactories { get; set; } = [];

    internal List<InnerStackSetStackInstancesFactory> StackInstancesGroupFactories { get; set; } = [];

    internal InnerStackSetOperationPreferencesFactory OperationPreferencesFactory { get; set; }

    internal InnerStackSetAutoDeploymentFactory AutoDeploymentFactory { get; set; }

    internal InnerStackSetManagedExecutionFactory ManagedExecutionFactory { get; set; }

    protected override Humidifier.CloudFormation.StackSet Create()
    {
        var stackSetResult = CreateStackSet();
        factoryAction?.Invoke(stackSetResult);

        return stackSetResult;
    }

    private Humidifier.CloudFormation.StackSet CreateStackSet()
    {
        var stackSetResult = new Humidifier.CloudFormation.StackSet
        {
            GivenName = InputResourceName,
        };

        return stackSetResult;
    }
    public override void CreateChildren(Humidifier.CloudFormation.StackSet result)
    {
        base.CreateChildren(result);

        result.Parameters = ParametersFactories.Any() ? ParametersFactories.Select(x => x.Build()).ToList() : null;
        result.StackInstancesGroup = StackInstancesGroupFactories.Any() ? StackInstancesGroupFactories.Select(x => x.Build()).ToList() : null;
        result.OperationPreferences ??= OperationPreferencesFactory?.Build();
        result.AutoDeployment ??= AutoDeploymentFactory?.Build();
        result.ManagedExecution ??= ManagedExecutionFactory?.Build();
    }

} // End Of Class

